import { Main } from './main/Main';
import './App.css';

function App() {
  return (


    <div className="App">

    <Routes> 
     <Route path="/" element={<Main/>}>
        </Route>
   </Routes> 
   <h1>hello world</h1>
    </div>


  );
}

export default App;
